import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <h2>A'Keia M.</h2>
      <nav>
        <ul>
          <li>
            <Link to="">Portfolio</Link>
          </li>
          <li>
            <a href="">Resume</a>
          </li>
          <li>
            <a href="">GitHub</a>
          </li>
          <li>
            <a href="">LinkedIn</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
